import { Outlet } from "react-router-dom";
import BasicLayout from "../../layouts/BasicLayout";

const IndexPage = () => {
    return ( 
        <BasicLayout>

            <div className="m-4 p-4 bg-green-400 text-2xl text-black">
            Board Index Page
            </div>

            <div className="h-[50vh] bg-white w-full border-3">
                <Outlet></Outlet>
            </div>

        </BasicLayout>
     );
}

export default IndexPage;
